import React from "react";
import logo from "../assets/Logo WO Branding-02 1.png";
import Button from "@mui/material/Button";
function Header() {
  return (
    <div>
      <div
        className=""
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          color: "#5D5D5F",
        }}
      >
        <img
          src={logo}
          alt="logo"
          style={{ width: "95.872px", height: "92.448px" }}
        />
        <div style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          color: "#5D5D5F",
        }}>
          <p>Webure</p>
          <p>About Us</p>
          <p>Services</p>
          <p>Career</p>
          <p>Clientele</p>
        </div>

        <Button variant="contain">Contact Us</Button>
      </div>
    </div>
  );
}

export default Header;
